import React from 'react'

function Footer() {
    return (
        <section id="Footer">
            <div className='bottom'>
                <div className='bottomLeft'></div>
                <div className='bottomCenter'></div>
                <div className='bottomRight'></div>
            </div>
        </section>
    )
}

export default Footer
